import styled from "styled-components";

export const Wrapper = styled.div`

    .ttx{
        background: url(${({ image }) => image}) ,no-repeat;-webkit-background-size: cover;
        -moz-background-size: cover;
        -o-background-size: cover;
        background-size: cover;

        height: 355px;
        width: 100%;
        display: table;
    }

    .nav_container{
        width: 100%;
        padding-right: 15px;
        padding-left: 15px;
        margin-right: auto;
        margin-left: auto;
        background-color: #242736;
    }

    .navs {
        background: #242736;
        min-height: 53px;
        overflow: auto;
    }
    .navs ul {
        margin: 0;
        padding: 0;
        list-style: none;
        margin: auto;
    }
    .navs li {
        float: left;
    }

    .navs-mobile{
        margin-left: 8%;
    }

    .navs-mobile a {
        display: block;
        padding: 9px 6px;
        line-height: 27px;
        color: #fff;
        text-decoration: none;
        font-size: 14px;
    }
    div .navs-mobile ul li i {
        font-size: 28px;
    }

`;

export const Context = styled.div``;
